rstarrte: Anscheinend gab es keinen anderen Ausweg aus diesem kleinen Hof als den Durchgang, durch den er gekommen war. Die Schritte wurden lauter und lauter, er sah eine dunkle Gestalt um die Ecke biegen. Fieberhaft irrten seine Augen durch die nchtliche Dunkelheit und suchten einen Ausweg. War jetzt wirklich alles vorbei,</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1040,1113,2,'2023-05-15 06:44:37','2023-05-15 06:49:13','18c47f09-5a5b-4fc3-81a9-15e685f4e6b0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p>Er hrte leise Schritte hinter sich. Das bedeutete nichts Gutes.</p>\n<ul>\n<li>Wer wrde ihm schon folgen,</li>\n<li>spt in der Nacht und dazu noch</li>\n<li>in dieser engen Gasse mitten</li>\n</ul>\n<p>im bel beleumundeten Hafenviertel? Gerade jetzt, wo er das Ding seines Lebens gedreht hatte und mit der Beute verschwinden wollte! Hatte einer seiner zahllosen Kollegen dieselbe Idee gehabt, ihn beobachtet und abgewartet, um ihn nun um die Frchte seiner Arbeit zu erleichtern? Oder gehrten die Schritte hinter ihm zu einem der unzhligen Gesetzeshter dieser Stadt, und die sthlerne Acht um seine Handgelenke wrde gleich zuschnappen? Er konnte die Aufforderung stehen zu bleiben schon hren. Gehetzt sah er sich um. Pltzlich erblickte er den schmalen Durchgang. Blitzartig drehte er sich nach rechts und verschwand zwischen den beiden Gebuden. Beinahe wre er dabei ber den umgestrzten Mlleimer gefallen, der mitten im Weg lag. Er versuchte, sich in der Dunkelheit seinen Weg zu ertasten und erstarrte: Anscheinend gab es keinen anderen Ausweg aus diesem kleinen Hof als den Durchgang, durch den er gekommen war. Die Schritte wurden lauter und lauter, er sah eine dunkle Gestalt um die Ecke biegen. Fieberhaft irrten seine Augen durch die nchtliche Dunkelheit und suchten einen Ausweg. War jetzt wirklich alles vorbei,</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(1041,1115,1,'2023-05-15 06:44:37','2023-05-15 06:44:37','87cb39bf-091